import React from "react";

const HomePage = () => (
  // or just <>
  <React.Fragment>
    <h1>Hello, welcome to students-react!</h1>
    <p>You can view some of your favorite students here.</p>
    <p>Surely, school is fun.</p>
  </React.Fragment>
);

export default HomePage;
